import React, { Component } from 'react'
import './home.css'
import  HeaderImage from '../imgs/Green_Logo.png';

export default class Home extends Component {
    constructor(props){
        super(props)
        this.state = {
            display: true, 
            autoplay: false,
        }
    }
    

render(){
    return(
        <div className='header'>
            <img src={HeaderImage} alt='header' style={{width:'35%', height:'80%'}}/>
        </div>
    )
}

}

const Green_logo = {
    width: '50 px', 
    height: '50 px',
    position: 'fixed', 
}
